const Card = () => {
    return (
        <div className="card">
            <img src="https://i1.sndcdn.com/artworks-2f4b52e3-85c5-4b6f-bda5-e569ec01ce9b-0-t500x500.jpg" />
            <div className="card-details">
                <h2 className="gold">SEX WITH MYSELF</h2>
                <h4 className="tan">JORDY</h4>
                <p className="beige">reviewed by Zhao Yang Kuah</p>
            </div>
        </div>
    );
}

export default Card;
